        /// <summary>
        /// Получение списка блюд
        /// </summary>
        /// <returns></returns>
        [HttpGet]
        public IHttpActionResult List()
        {
            var db = new ApplicationDbContext();
            var response = db.Dishes.Select(c => new DishViewModel()
            {
                Id = c.Id,
                Name = c.name,
                Consist = c.Consist,
                Price = c.sellingPrice,
                Unit = c.Unit
            }).OrderBy(b => b.Name).ToList();
            return Json(response);
        }
